INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (1, 91002, "ぺコリーヌ", 107501, 0, 1, 37, 150, 40001, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 8);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (2, 91002, "コッコロ", 107601, 0, 1, 38, 150, 40001, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 8);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (3, 91002, "キャル", 107801, 0, 1, 39, 150, 40001, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 8);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (4, 91002, "スズメ", 107701, 0, 1, 40, 150, 40001, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 8);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (5, 91002, "タマキ", 107901, 0, 1, 41, 150, 40001, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 8);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (6, 91002, "ぺコリーヌ", 107501, 0, 2, 42, 150, 40001, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 8);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (7, 91002, "コッコロ", 107601, 0, 2, 43, 150, 40001, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 8);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 91002, "キャル", 107801, 0, 2, 44, 150, 40001, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 8);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (9, 91002, "スズメ", 107701, 0, 2, 45, 150, 40001, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 8);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (10, 91002, "タマキ", 107901, 0, 2, 46, 150, 40001, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 8);
